#Função que converte o plano de string para um valor númerico#Quanto maior o número, melhor o planodef plano(x):    if x == "premium":        return 5    if x == "diamante":        return 4    if x == "ouro":        return 3    if x == "prata":        return 2    if x == "bronze":        return 1    if x == "resto":        return 0#Lê o número de pacientesn = int(input())# Ler os pacientespacientes = []for i in range(n):    pacientes.append(input().split())    #Converte a gravidade de string para int    pacientes[i][2] = int(pacientes[i][2])#Ordena a lista pacientes#Primeiro por ordem alfabética do nomepacientes = sorted(pacientes, key = lambda x: x[0])#Agora, por gravidadepacientes = sorted(pacientes, key = lambda x: x[2], reverse=True)#Finalmente, por planopacientes = sorted(pacientes, key = lambda x: plano(x[1]), reverse=True)#Imprime o nome dos pacientes na ordemfor i in range(n):    print(pacientes[i][0])